import React, {Component} from 'react';
import '../css/Nav.css';
import menu from '../assets/menu.svg'

import MobileNavigation from './MobileNavigation';
import Navigation from './Navigation';



class NavBar extends Component {

    render(){
      return (
        <div className="Nav">
          <Navigation/>
          <MobileNavigation/>
        </div>
      );
    }
  }

  export default Nav;
